from Crypto.Cipher import AES
import base64

# Define the key and initialization vector
key =b'xjamx53avd453clo'
iv = b'x5a3zmi8nr4xa7mr'
#key=key1.encode('utf8')
# Define the encoded encrypted shellcode to be decrypted
encoded_encrypted_shellcode = b''

# Decode the encoded encrypted shellcode
encrypted_shellcode = base64.b64decode(encoded_encrypted_shellcode)

# Create an AES cipher object
cipher = AES.new(key, AES.MODE_CBC, iv)

# Decrypt the shellcode
decrypted_shellcode = cipher.decrypt(encrypted_shellcode)

# Print the decrypted shellcode
print(b"Decrypted Shellcode: " + decrypted_shellcode)
#print(type(decrypted_shellcode))